import React from 'react'
import Order from './Order/Order'

import './Orders.css'

const orders = (props) => {
    const allOrders = new Array(6,4,6,7,8,9,9).map(value=>{
        return <Order />
    })

    return <div className="orders">allOrders</div>
}

export default orders
